"statics" is a JavaScript map. Therefore, the values within it must be in key:value format. You may not use an equal sign; you must use a colon.

That said, I don't believe it works to initialize a static member with an instance of a class within the statics section. Instead, do:

statics :
{
  DATEFORMAT_MDY : null
},

defer : function(statics)
{
  statics.DATEFORMAT_MDY = new qx.util.format.DateFormat("MM/dd/yyyy");
}

